import React from 'react';

const ExerciseImage = ({ src, alt, title }) => {
  return (
    <div 
      style={{
        width: '400px',
        height: '300px',
        backgroundColor: '#f8f9fa',
        border: '1px solid #dee2e6',
        borderRadius: '8px',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        color: '#6c757d',
        fontSize: '14px',
        fontWeight: 'bold',
        margin: '0 auto'
      }}
    >
      <div style={{ textAlign: 'center' }}>
        <i 
          className="fas fa-dumbbell fa-3x mb-2" 
          style={{ color: '#007bff' }}
        ></i>
        <div>{title}</div>
        <small style={{ color: '#6c757d' }}>
          {alt}
        </small>
      </div>
    </div>
  );
};

export default ExerciseImage;
